<h1>Step run</h1>
<p><b>Plaats</b>: Rondom de dierenweide (inclusief heuvel)
<br><b>Aantal deelnemers</b>: 8 deelnemers per team
<br><b>Speeltijd</b>: 20 minuten
<br><b>Boetes</b>: zie hieronder</p>

<h2>Spelregels</h2>
<ul>
<li>Van elk team lopen 4 deelnemers en 4 deelnemers steppen het parcours (zie tekening). Ze beginnen met steppen, de volgende 2 lopen, enzovoort. Een lint moet worden overgedragen binnen het wisselgebied. De laatste deelnemer bepaalt de eindtijd.</li>
</ul>

<h2>Sancties</h2>
<ul>
<li>Bij opzettelijke obstructie wordt een boetetijd opgelegd. Als de wissel niet plaatsvindt in het wisselgebied, volgt er een boete.</li>
<li>Bij materiaalpech is er een tweede kans (tijdens de pauze of aan het einde van de dag).</li>
</ul>

